import profile_pic from './../../profile_pic.JPEG'
function Discord(){
    const profilePic = require('./../../profile_pic.JPEG');
    //<img className='w-6/12 h-1/12 rounded-lg' src={profilePic} />
    return (
        <div className='mt-36 mr-64 w-80 h-96 ml-24 bg-slate-700 rounded-lg relative '>
                <div className='bg-amber-600 rounded-t-lg h-1/3'>

                </div>
                <div className='absolute left-4 top-12 '>
                    <img className='h-24 w-24 rounded-full border-6 border-slate-700 ' src={profilePic} />
                </div>

		</div>
    )
}
export default Discord;
